import React, { Component } from "react";
import "./estiloNotas.css"

export default class CardNota extends Component {

    render() {
        return (
            <section className="nota">
                <header>
                    <h3>titulo</h3>
                </header>
                <p>escreve sua nota aqui</p>
            </section>
        )
    }
}

